import React from 'react';
import Home from './Home';
import About from './About';
import ContactUs from './ContactUs';
import Variables from './Variables';
import Printing from './Printing';
import UserInput from './UserInput';
import IfStatement from './IfStatement';
import BooleanLogic from './BooleanLogic';
import ForLoop from './ForLoop';
import WhileLoop from './WhileLoop';
import Comments from './Comments';
import Functions from './Functions';
import RandomNumbers from './RandomNumbers';
import ASCII from './ASCII';
import Break from './Break';
import Strings from './Strings';
import Mathematics from './Mathematics';
import ArrayList from './ArrayList';
import HashMap from './HashMap';
import Arrays from './Array';
import Arithmetic from './Arithmetic';
import Nesting from './Nesting';
import GettingStarted from './GettingStarted';
import TwoDimArrays from './TwoDimArrays';
import Casting from './Casting';
import Constants from './Constants';
import Overloading from './Overloading';
import ForEachLoop from './ForEachLoop';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  useLocation,
  Link
} from "react-router-dom";

class Content extends React.Component{
	constructor(props){
		super(props)
	}

	getPage(user){
		<Switch>
	        <Route exact path="/">  
	          <Home user={user}/>
	        </Route>

	        <Route path="/home">
	          <Home user={user}/>
	        </Route>

	        <Route path="/constants">
	          <Constants user={user}/>
	        </Route>

	        <Route path="/about">
	          <About user={user}/>
	        </Route>

	        <Route path="/contact-us">
	          <ContactUs user={user}/>
	        </Route>

	        <Route path="/variables">
	          <Variables user={user}/>
	        </Route>

	        <Route path="/printing">
	          <Printing user={user}/>
	        </Route>

	        <Route path="/user-input">
	          <UserInput user={user}/>
	        </Route>

	        <Route path="/if-statement">
	          <IfStatement user={user}/>
	        </Route>

	        <Route path="/boolean-logic">
	          <BooleanLogic user={user}/>
	        </Route>

	        <Route path="/for-loop">
	          <ForLoop user={user}/>
	        </Route>

	        <Route path="/while-loop">
	          <WhileLoop user={user}/>
	        </Route>

	        <Route path="/comments">
	          <Comments user={user}/>
	        </Route>

	        <Route path="/functions">
	          <Functions user={user}/>
	        </Route>

	        <Route path="/for-each-loop">
	          <ForEachLoop user={user}/>
	        </Route>

	        <Route path="/random-numbers">
	          <RandomNumbers user={user}/>
	        </Route>

	        <Route path="/ascii">
	          <ASCII user={user}/>
	        </Route>

	        <Route path="/hashmap">
	          <HashMap user={user}/>
	        </Route>

	        <Route path="/array">
	          <Arrays user={user}/>
	        </Route>

	        <Route path="/math">
	          <Mathematics user={user}/>
	        </Route>

	        <Route path="/strings">
	          <Strings user={user}/>
	        </Route>

	        <Route path="/arraylist">
	          <ArrayList user={user}/>
	        </Route>

	        <Route path="/arithmetic">
	          <Arithmetic user={user}/>
	        </Route>

	        <Route path="/break">
	          <Break user={user}/>
	        </Route>

	        <Route path="/getting-started">
	          <GettingStarted user={user}/>
	        </Route>

	        <Route path="/nesting">
	          <Nesting user={user}/>
	        </Route>

	        <Route path="/2d-array">
	          <TwoDimArrays user={user}/>
	        </Route>

	        <Route path="/casting">
	          <Casting user={user}/>
	        </Route>

	        <Route path="/overloading">
	          <Overloading user={user}/>
	        </Route>
	    </Switch>
	}

	render(){
		window.scrollTo(0, 0); //move to content when you create content component!!! this is not working rn
	    const {
	      user,
	      signOut,
	      signInWithGoogle,
	    } = this.props;
		return (
			<div className = "page">
				<h2>{this.props.page}:</h2>
				<br/>
				{this.getPage(user)}
			</div>
		)
	}
}

export default Content;
